import React from "react";
import CreateMyCampaignForm, {
  cardData,
} from "./components/createCampaign/CreateMyCampaignForm";
import DonorOrNGO from "./components/DonorOrNGO";
import { Switch, Route, Redirect } from "react-router-dom";
import SignUpAsDonor from "./components/Auth/SignUpAsDonor";
import SignUpAsNGO from "./components/Auth/SignUpAsNGO";
import LogInAsDonor from "./components/Auth/LogInAsDonor";
import LogInAsNGO from "./components/Auth/LogInAsNGO";
import CampaignCards from "./components/CampaignCards";
function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <Redirect to="/landingPage" />
        </Route>
        <Route path="/landingPage">
          <DonorOrNGO />
        </Route>
        <Route path="/suD">
          <SignUpAsDonor />
        </Route>
        <Route path="/suN">
          <SignUpAsNGO />
        </Route>
        <Route path="/liD">
          <LogInAsDonor />
        </Route>
        <Route path="/liN">
          <LogInAsNGO />
        </Route>
        <Route path="/cmcF">
          <CreateMyCampaignForm />
        </Route>
        <Route path="/myCard">
          <CampaignCards data={cardData} />
        </Route>
      </Switch>
    </div>
  );
}
